import React, { Fragment, Component } from 'react';


class homeForm extends Component{
    render(){
        return(
            <Fragment>
                <form>
                    <div className="FormFields">
                        <input type='file' id='customFile'/>

                    </div>

                </form>

            </Fragment>
        );
    }
}

export default homeForm;
